import React,{Component} from 'react'

let dialogStyle ={
    width:'500px',
    maxWidth:"100%",
    margin:'0 auto',
    position:"fixed",
    left:"50%",
    top:'50%',
    transform:"translate(-50%,-50%)",
    zIndex:'999',
    background:'10px 20px 40px',
    borderRadius:"8px",
    display:"flex",
    fixDirection:"column"
}

class Dialog extends Component{
    render(){
        return(
            <div style = {dialogStyle}>
                <button>x</button>
                <div >{this.props.children}</div>
            </div>
        )
    }
}

export default Dialog
